//IMPORT MODULES
import NavBar from './NavBarWhite';
import Contact from './Contact';

class Catalunya extends React.Component{
    render(){
        return(
            <div className="Catalunya">
                <NavBar/>
                <h1>Catalunya</h1>

                <Contact/>
            </div>
        )
    }
}

export default Catalunya
